import React, { useState, useEffect } from "react";
import "../styles/chatbot.css";

export default function ChatbotUI() {
  const [messages, setMessages] = useState([]);
  const [input, setInput] = useState("");
  const [qaData, setQaData] = useState([]);
  const [isMinimized, setIsMinimized] = useState(true); // initially minimized

  // Load question-answer data
  useEffect(() => {
    fetch("/chatbot-data.json")
      .then((res) => res.json())
      .then((data) => setQaData(data))
      .catch((err) => /* eslint-disable */console.error(...oo_tx(`2704817531_15_22_15_72_11`,"Failed to load chatbot data:", err)));
  }, []);

  // Send user message and get bot response
  const sendMessage = () => {
    if (!input.trim()) return;

    const userMessage = { text: input, type: "user" };
    setMessages((prev) => [...prev, userMessage]);

    const lower = input.toLowerCase();

    const match = qaData.find(
      (item) =>
        item.question &&
        typeof item.question === "string" &&
        (lower === item.question.toLowerCase() ||
          lower.includes(item.question.toLowerCase()) ||
          item.question.toLowerCase().includes(lower))
    );

    const botMessage = {
      text: match?.answer || "Sorry, I don’t understand that yet.",
      type: "bot",
    };

    setMessages((prev) => [...prev, botMessage]);
    setInput("");
  };

  return (
    <div className={`chatbot-container ${isMinimized ? "minimized" : ""}`}>
      <div className="chatbot-header" onClick={() => setIsMinimized(!isMinimized)}>
        Chatbot
        <span style={{ fontWeight: "normal" }}>{isMinimized ? "▲" : "▼"}</span>
      </div>

      <div className="chat-window">
        {messages.map((msg, index) => (
          <div key={index} className={`message ${msg.type}`}>
            {msg.text}
          </div>
        ))}
      </div>

      <div className="input-row">
        <input
          type="text"
          placeholder="Ask me..."
          value={input}
          onChange={(e) => setInput(e.target.value)}
          onKeyDown={(e) => e.key === "Enter" && sendMessage()}
        />
        <button onClick={sendMessage}>Send</button>
      </div>
    </div>
  );
}
